import { useEffect } from "react";
import Post from "../components/Post";

export default function IndexPage(){
  useEffect(()=>{
    const response=fetch('/post').then(response=>{
      response.json()
    })
  })

  return(
    <div>
      <Post/>
      <Post/>
      <Post/>
    </div>
  )
}
